import React from "react";

class Characters extends React.Component {
    state = {
        characters: []
    };

    handleClick = () => {
        console.log("you selected me!");
    }

    render() {
        return (
            <div className="grid-container">
                <div className="grid-item">
                    <img src="bobbelcher.png" alt="bob belcher" onClick={handleClick}/>
                </div>
                <div className="grid-item">
                    <img src="lindabelcher.png" alt="linda belcher" />
                </div>
                <div className="grid-item">
                    <img src="louisebelcher.png" alt="louise belcher" />
                </div>
                <div className="grid-item">
                    <img src="teddy.png" alt="teddy" />
                </div>
                <div className="grid-item">
                    <img src="jimmypestojr.png" alt="jimmy pesto jr" />
                </div>
                <div className="grid-item">
                    <img src="andyandolliepesto.png" alt="andy and ollie pesto" />
                </div>
                <div className="grid-item">
                    <img src="mort.png" alt="mort" />
                </div>
                <div className="grid-item">
                    <img src="tinabelcher.png" alt="tina belcher" />
                </div>
                <div className="grid-item">
                    <img src="genebelcher.png" alt="gene belcher" />
                </div>
            </div>
        );
    }
}

export default Characters;
